import React, { useState, useEffect } from 'react';

function ViewStories() {

    const [story, setStory] = useState([]);

    //GET story
    const getStory = () => {
        fetch('http://localhost:4000/stories')
        .then(res => res.json())
        .then(data => {
            console.log(data);
            let array = data.map(ob => <p key={ob._id}>{ob.body}</p>)
            setStory(array);
        })
    }


  return (
    <div>
        <button onClick={getStory}>View Stories</button>
        <div>{story}</div>
    </div>
  )
}

